import React, { Component } from "react";
import Link from "next/link";

class Home extends Component {
    render() {
        return (
            <div>
                <h1>Hello, from Home page</h1>
                <Link href="/Contact">
                    <a>Contact</a>
                </Link>
                <br />
                <Link href="/blog">
                    <a>Blog</a>
                </Link>
                <style jsx>
                    {`
                        h1{
                            color: green;
                            text-align:center;
                            padding:20px
                        }
                        div{
                            background: white
                        }
                        a{
                            font-size:14px;
                            color:black;
                            text-decoration:none
                        }
                    `}

                </style>
                <style global jsx>
                    {`
                            body{
                                background:white
                            }
                        `}
                </style>
            </div>
        )
    }
}

export default Home
